import React, { useEffect, useState } from 'react';


export default function AllEmployee() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:9000/getall")
      .then((res) => res.json())
      .then((val) => {
        setData(val);
        console.log(val);
      })
      .catch((err) => console.log("Unable to fetch", err));
  }, []); 

  return (
    <>
    <h1 className='emph1'>Employee Data</h1>
    <div className='backsize mt-5' >
      <table className="table">
        <thead>
          <tr>
            <th scope="col">Id</th>
            <th scope="col">Name</th>
            <th scope="col">Email</th>
            <th scope="col">Mobile</th>
            <th scope="col">Joining Date</th>
            <th scope="col">Salary</th>
          </tr>
        </thead>
        <tbody>
          {data && data.length > 0 &&
            data.map((val, index) => {
              return (
                <tr key={index}>
                  <th scope="row">{val.id}</th> {/* Corrected to dynamically show id */}
                  <td>{val.name}</td>
                  <td>{val.email}</td>
                  <td>{val.mobileno}</td>
                  <td>{val.joiningdate}</td>
                  <td>{val.salary}</td>
                </tr>
              );
            })
          }
        </tbody>
      </table>
    </div>
    </>
  );
}
